import glassCoffe from "../../../assets/glassCoffe.jpg";
import Card from "../../UI/Card";

const Images = (props) => {
  return (
    <Card>
      <img src={glassCoffe} alt="coffe"></img>;
    </Card>
  );
};

export default Images;
